import { BACKEND_URL } from "../constants";
import axios from "axios";

const adminApi = axios.create({
    baseURL: BACKEND_URL
})

export const getAllDoctors = async () => {
    const response = await adminApi.get("admin/get-all-doctors");
  
    return response.data;
  };
